import React from "react";


function MtgCard({cards, handleOnClick}){
    return (
      <div key={cards.id} className="cardTile"onClick={handleOnClick}>
        <img key={cards.id} src={cards.imageUrl} alt="404" />
      </div>
    )
}

export default MtgCard;
